import './scss/app.scss';

import Header from "./components/Header";

import Shops from "./components/Shops";

import Sort from "./components/Sort";
import ProductBlock from "./components/ProductBlock";

import products from "./assets/products.json"
import ProductSceleton from "./components/Sceleton";


function App() {

  const skeletons = [...new Array(8)].map((_, idx) => <ProductSceleton key={idx}/>)
  console.log(skeletons)
  const items = products.map(product => <ProductBlock title={product.title} imageUrl={product.imageUrl}
                                                      price={product.price} measure={product.measure}
                                                      key={product.title}/>)

  return (
    <div className="wrapper">
      <Header/>
      <div className="content">
        <div className="container">
          <div className="content__top">
            <Shops/>
            <Sort/>
          </div>
          <h2 className="content__title">All goods</h2>
          <div className="content__items">

            {
              items &&
              skeletons
              //:
              // products.map(product => {
              //   return <ProductBlock title={product.title} imageUrl={product.imageUrl}
              //                        price={product.price} measure={product.measure}
              //                        key={product.title}
              //   />
              // })
            }
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
